	add("gerontocrat", "{\"term\":\"gerontocrat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|geronto|crat|lang\u003den}}, after \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a gerontocracy; an aged leader, especially one clinging on to power or ruling only by virtue of age\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0027Hitch-22\u0027, Atlantic 2011, p. 98\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In Poland, a so-called anti-Zionist urge proved that the Stalinist \u0027\u0027gerontocrats\u0027\u0027 would stoop even to Hitlerite tactics to repress dissent and prolong their sterile and boring hold on power\", \"priority\":3}]}, \"synonyms\":{}}");

