	add("gerund", "{\"term\":\"gerund\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027gerundium\u0027 from \u0027gerundus\u0027 (which is to be carried out) future passive participle (gerundive) of \u0027gerō\u0027 (carry, bear)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A verbal form that functions as a verbal noun. (In English, a gerund has the same spelling as a present participle, but functions differently\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Edward Johnson, \u0027The Handbook of Good English\u0027, [http://books.google.com.au/books?id\u003dn0IJ8GcdJ6IC\u0026amp;pg\u003dPA208\u0026amp;dq\u003d%22gerund%22%7C%22gerunds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnQwEVMTaM4Lg8AWPloCADA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22gerund%22%7C%22gerunds%22\u0026amp;f\u003dfalse page 208\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Compounds in which \u0027\u0027gerunds\u0027\u0027 are the second element look exactly like compounds in which present participles are the second element, but different principles of hyphenation apply\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Dan Mulvey, \u0027Grammar the Easy Way\u0027, [http://books.google.com.au/books?id\u003dL9ni2hGHlMEC\u0026amp;pg\u003dPA25\u0026amp;dq\u003d%22gerund%22%7C%22gerunds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnQwEVMTaM4Lg8AWPloCADA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22gerund%22%7C%22gerunds%22\u0026amp;f\u003dfalse page 25\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Like any noun, the \u0027\u0027gerund\u0027\u0027 functions as a subject, direct object, indirect object, object of the preposition, or predicate nominative. The \u0027\u0027gerund\u0027\u0027 phrase is made up of the present participle (\u0026quot;-ing\u0026quot;) and can contain an object and/or a modifier (and sometimes many modifiers). The \u0027\u0027gerund\u0027\u0027 is a verbal noun\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Gary Lutz, Diane Stevenson, \u0027The Writer\u0027s Digest Grammar Desk Reference\u0027, [http://books.google.com.au/books?id\u003dSsQ9ugnMcpUC\u0026amp;pg\u003dPA55\u0026amp;dq\u003d%22gerund%22%7C%22gerunds%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnQwEVMTaM4Lg8AWPloCADA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22gerund%22%7C%22gerunds%22\u0026amp;f\u003dfalse page 55\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Gerunds\u0027\u0027 and \u0027\u0027gerund\u0027\u0027 phrases are always nouns, so they are always predicate nominatives when used as complements. Do be careful to distinguish progressive-tense verbs from \u0027\u0027gerunds\u0027\u0027 used as subjective complements\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In some languages such as Italian or Russian, a verbal form similar to a present participle, but functioning as an adverb. \u0027These words are sometimes referred to as conjunctive participles\", \"priority\":11}]}, \"synonyms\":{}}");

	add("gerundive", "{\"term\":\"gerundive\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|gerundīvus||of a gerund}}, from \u0027gerundium\u0027 (gerund) from \u0027gerundus\u0027 (which is to be carried out) future passive participle (gerundive) of {{m|la|gerō||carry, bear}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a verbal adjective that describes obligation or necessity, equivalent in form to the future passive participle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a verbal adjective ending in \u0027-ing\u0027 \u0026lt;ref name\u003d\u0026quot;Macquarie\u0026quot;\u0026gt;the Australian \u0027Macquarie Dictionary\u0027 (revised 3rd ed), second sense of \u0027\u0027\u0027Gerundive\u0027\u0027\u0027\u0026lt;/ref\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

